import React from 'react';
import './styles.css'

function ProjectCard(props) {

  return (
    <div className="card-project card0" style={{
      backgroundImage: `url(${props.url})`
      }}>
      <h1>{props.name}</h1>
    </div>
  );
}

export default ProjectCard;
